import React from "react";

const Scroll = props => {
  return (
    <div
      style={{
        overflow: "scroll",
        overflowY: "hidden",
        border: "no border",
        height: "400px"
      }}
    >
      {props.children}
    </div>
  );
};
export default Scroll;
